import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from 'react-router-dom';
import StoreProvider from '../Components/Store/Provider';
//import RoutesPrivate from '../components/container/Routes/Private/Private';
//import Home from '../components/container/presentational/lv5/Dashboard';
//import Login from '../components/container/presentational/lv5/Preferences';
//import Cadastro from '../components/container/presentational/lv5/cadastro';

//import Cadastro from '../App';
import Cadastro from '../Components/presentational/lv5/page_login_kanri';

const PagesRoot = () => (
  <Router>
    <StoreProvider>
      <Switch>

        <Route path="/cadastrar" component={Cadastro} />

      </Switch>
    </StoreProvider>
  </Router>
)

export default PagesRoot;
